use reqwest::blocking::get;
use reqwest::header::{HeaderMap, HeaderValue, USER_AGENT};
use clipboard::ClipboardProvider;
use flite::{TTS, Voice};

fn main() {
    // Set up the ElevenLabs API client
    let mut headers = HeaderMap::new();
    headers.insert(USER_AGENT, HeaderValue::from_static("my-app/1.0"));
    let client = reqwest::blocking::Client::builder()
        .default_headers(headers)
        .build()
        .unwrap();

    // Read the contents of the clipboard
    let mut clipboard = ClipboardProvider::new().unwrap();
    let clipboard_text = clipboard.get_contents().unwrap();

    // Make a request to the ElevenLabs API to generate TTS audio
    let api_url = "https://api.elevenlabs.io/tts";
    let api_key = "your-api-key-here";
    let request_url = format!("{}?text={}&voice=en-US&apikey={}", api_url, clipboard_text, api_key);
    let response = client.get(&request_url).send().unwrap();
    let audio_data = response.text().unwrap();

    // Play the TTS audio using the `flite` library
    let tts = TTS::new();
    let voice = Voice::new("cmu_us_rms");
    tts.set_voice(&voice);
    tts.say_text(&clipboard_text);
}
